Based on https://github.com/Microsoft/TypeScript-Handbook/blob/master/pages/Writing%20Definition%20Files.md

Before:(this is wrong)

``` typescript
import React from "react-native";
const {StyleSheet, Text, View} = React;
```

to:

``` javascript
var react_native_1 = require("react-native");
const { StyleSheet, Text, View } = react_native_1.default;
```

After:(this is right)

``` typescript
import * as React from "react-native";
const {StyleSheet, Text, View} = React;
```

to:

``` javascript
var React = require("react-native");
const { StyleSheet, Text, View } = React;
```

When using some third party's `koa` middleware libraries, we need use the type of `koa`'s ctx directly. Then we could:

``` ts
import * as Koa from 'koa'

async function (ctx: Koa.Context, next: Function) {
  // ...
}
```
